import React from "react";
import "./App.css";
import { Link } from "react-router-dom";

const linkStyle = {
  color: "white",
  textDecoration: "none",
  cursor: "pointer",
};

const Header = () => (
  <header className="App-header">
    <div className="container">
      <h1>No Due Management System</h1>
      <p>Efficiently manage and track dues with our user-friendly system.</p>
    </div>
  </header>
);

const Features = () => (
  <section id="features" className="App-section">
    <div className="container">
      <h2>Key Features</h2>
      <ul>
        <li>Track dues and deadlines</li>
        <li>User-friendly interface</li>
        <li>Secure and reliable</li>
        <li>Easy integration</li>
      </ul>
    </div>
  </section>
);

const CTA = () => (
  <section id="cta" className="App-section App-cta">
    <div className="container">
      <h2>Get Started Today</h2>
      <p>Join thousands of users already managing their dues with NDM.</p>
      {/* <Link to="/Wheel/st" style={linkStyle}>
            <button>Croc Wheel</button>
          // </Link> */}
      Log In
      {/* </Link> */}
    </div>
  </section>
);

const Footer = () => (
  <footer className="App-footer">
    <div className="container">
      <p>&copy; 2024 No Due Management System. All rights reserved.</p>
    </div>
  </footer>
);

function App() {
  return (
    <div className="App">
      <Header />
      <Features />
      <CTA />
      <Footer />
    </div>
  );
}

export default App;
